if mibBuilder.loadTexts: docsDevTrapMIB.setDescription('CABLE DEVICE TRAP MIB is an extension of the CABLE DEVICE MIB defined in RFC2669. It defines various trap objects for both cable modem and cable modem termination system. There are two groups of SNMP notification objects are defined. One group is for notifying cable modem events and one group for notifying cable modem termination system events. Common to all CM notification objects (traps) is that in their OBJECTS statements, A CM trap contains information about the event priority, the event Id, the event message body, the CM DOCSIS capability, the CM DOCSIS register registration status, the cable interface MAC address of the cable modem and the cable card MAC address of the CMTS to which the modem is connected to. These objects are docsDevEvLevel, docsDevId, docsDevEvText, docsIfDocsisCapability, docsIfDocsisOperMode, ifPhysAddress and docsIfCmCmtsAddress. The values of docsDevEvLevel, docsDevId, and docsDevEvText are from the entry which logs this event in the docsDevEventTable, which is defined in DOCS-CABLE-DEVICE-MIB of RFC2669. The docsIfDocsisCapability and docsIfDocsisOperMode are defined in DOCS-IF-EXT-MIB. The ifPhysAddress value is the MAC address of the cable interface of this cable modem. The docsIfCmCmtsAddress specifies the MAC address of the CMTS (if there is a cable card/interface in the CMTS, then it is actually the cable interface interface MAC address to which the CM is connected). Individual CM trap may contain additional objects to provide necessary information. Common to all CMTS notification objects (traps) is that in their OBJECTS statements, A CMTS trap contains information about the event priority, the event Id, the event message body, the connected CM DOCSIS register status, the CM cable interface MAC address, the CMTS DOCSIS register status and the CMTS MAC address. These objects are docsDevEvLevel, docsDevId, docsDevEvText, docsIfCmtsCmStatusDocsisMode, docsIfCmtsCmStatusMacAddress, docsIfDocsisCapability, and ifPhysAddress. The values of docsDevEvLevel, docsDevId, and docsDevEvText are similar to what in CM traps. The values of docsIfCmtsCmStatusDocsisMode and docsIfCmtsCmStatusMacAddress are from the docsIfCmtsCmStatusEntry (defined in DOCS-IF-MIB) corresponding to a conneced CM. The docsIfDocsisCapability indicates the CMTS DOCSIS capability. The ifPhysAddress value is the CMTS MAC address (if there is a cable card/interface in the CMTS, then it is actually the MAC address of the cable interface which connected to the CM). ')
